INSERT INTO `cactus` (`id_cactus`, `title`, `description`, `cost`, `photo`) VALUES
(1, 'Цереус', 'Отличается длинным цилиндрическим стеблем. Может достигать 20 метров в высоту, продолжительность жизни до 300 лет. Бывают низкие виды, растущие в виде кустарника или стелющиеся (цепляющиеся с помощью воздушных корней). Род объединяет около 50 видов и множество разновидностей. У крупных видов хорошо развит ствол и крона из безлиственных побегов. Стебли с крупными ребрами, корневая система мощная. На фоне зеленовато-голубоватого стебля красиво выделяются серые, коричневые или черные колючки. Ночью распускаются крупные (до 25 см в длину) зеленовато-белые, белые или розовые цветки. Плоды съедобны, желтого или красного цвета, ягодообразные, голые, более 10 см длиной. В культуре закрытых помещений цереусы являются одними из самых неприхотливых кактусов. Нетребовательны к свету и земле смеси. В естественных условиях размножается семенами и иногда черенками - некрупными частями стебля, которые могут прорастать, попадая на землю. Родина - Вест-Индия, Центральная и Южная Америка, где они широко распространены. Как крупномерные кактусы находят самое широкое применение в озеленении различных помещений, зимних садов, витрин, создании декоративных кактусных горок. Отличаются быстрым ростом и зарекомендовали себя как один из наиболее выносливых подвоев.', 1399, );
INSERT INTO `cactus` (`id_cactus`, `title`, `description`, `cost`, `photo`) VALUES
(2, 'Нотокактус', 'Небольшие круглые стволы с очень красивыми ребрами и крупными бугорками делают нотокактусы неизменно популярными. И хотя сегодня эти кактусы переквалифицированы лишь в одну из многочисленных групп среди Пародий, «бывшими» их никто не называет. Ценят нотокактусы, в первую очередь, за их цветение, а не за красоту стеблей. Огромные, широко раскрытые воронковидные цветки не случайно считаются одними из самых изысканных среди всех кактусов. Добиться цветения у нотокактусов можно только при их правильной зимовке. Но все же выращивать их поразительно просто. Не настолько устойчивые к длительной засухе, они являются идеальными кандидатами для создания комнатных садиков суккулентов, украшения декоративных флорариумов и композиций.', 2300, );
INSERT INTO `cactus` (`id_cactus`, `title`, `description`, `cost`, `photo`) VALUES
(3, 'Опунция', 'Опунции распространены на обширных территориях Северной и Южной Америки, включая Вест-Индию. В Мексике, являющейся главным районом произрастания рода, сосредоточена почти половина видов опунции. Согласно легенде ацтеков, Теночтитлан (нынешний Мехико) был основан на месте, где росла опунция, на которой сидел орёл, поедающий змею. Эта сцена из легенды отображена на гербе Мексики. Как интродуцированные растения некоторые виды опунции распространились в тропических и субтропических регионах всего мира.', 1599, );
INSERT INTO `cactus` (`id_cactus`, `title`, `description`, `cost`, `photo`) VALUES
(4, 'Фрайлея', 'Представители рода — растения с шаровидными или короткими цилиндрическими побегами высотой обычно не более 10 см и диаметром стебля 2-5 см. Растения нередко ветвятся. Ареолы мелкие, расположены часто. Рёбра и сосочки выражены слабо. Колючки длиной до 0,7 см, от светло-желтоватых до чёрных.\r\nБутоны густоопушённые. Цветки разных оттенков жёлтого, крупные в сравнении с размером самого растения. Характерной особенностью фрайлей является клейстогамия. При этом возможно перекрестное опыление, так как у большинства видов и разновидностей развиваются и хазмогамные (раскрывающиеся) цветки тоже. Клейстогамных цветков нет только у трех видов: Frailea amerhauseri, Frailea chiquitana и Frailea larae. Обычно у молодых растений формируются только клейстогамные цветки, а хазмогамные образуются у растений более старшего возраста. Хазмогамные цветки могут формироваться как летом, так и под осень, когда они открываются при температуре окружающего воздуха около 20°C. Семена крупные, образуются легко, в большом количестве, всходят быстро и хорошо.', 3499, );
INSERT INTO `cactus` (`id_cactus`, `title`, `description`, `cost`, `photo`) VALUES
(12, 'Алоэ', 'Ало́э, столетник (Aloe), род растений семейства асфоделовых. Древовидные, кустарниковые или травянистые суккулентные ксерофиты, иногда лианы. Листья мясистые, очень сочные, зубчатые, в плотных прикорневых или верхушечных розетках. Цветки трубчатые или узкоколокольчатые, красные, оранжевые или жёлтые, в кистях или метёлках. Плоды – коробочки с многочисленными семенами. Более 360 видов, распространённых в засушливых областях Южной и Тропической Африки, на Маскаренских о-вах, о. Мадагаскар, на юге Аравийского п-ова. Алоэ древовидное, или столетник (Aloe аrborescens), – популярное комнатное растение, известное своими лечебными свойствами (дезинфицирующее, ранозаживляющее, общеукрепляющее действие); в естественных условиях размножается семенами. Многие виды, например алоэ настоящее (Aloe vera) и алоэ неустрашимое (Aloe ferox), разводят для получения лекарственного сырья (листья, содержащие гликозиды, смолистые вещества и эфирное масло), используемого в фармацевтической и парфюмерной промышленности.', 159, );

